import NoteState from './Context/NoteState';

function App() {
  return (  

<>
<NoteState>
<BrowserRouter>
<Navbar/>
  <div className=" my-20 App">
    <h1>helloe</h1>

  </div>

    <Routes>
      <Route path="/home" element={<Home/>} />
      <Route path="/about"element={<About/>}/>
      {/* <Route path="*" element={<Error />} /> */}
    </Routes>

</BrowserRouter>
</NoteState>

  </>

  );
}

export default App;
